import Vue from 'vue'
import App from './App.vue'
import vuetify from './plugins/vuetify'
import { routes } from './routes'

const router = new VueRouter({
  routes : routes
});

Vue.config.productionTip = false

export const eventBus = new Vue({

  methods : {
    sendToData(menuData){
      this.$emit("pageData", menuData);
    }
  }
});
new Vue({
  vuetify,
  render: h => h(App)
}).$mount('#app')
